// createRandomDataTable
export function createRandomDataTable(): DataTable {
    // dataValuesDepth
    let dataValuesDepth = new DataValues();
    dataValuesDepth.values = Array.from(defaultDepth);
    dataValuesDepth.name = "DEPTH";
    dataValuesDepth.unit = "F";
    dataValuesDepth.updateMinMax();
    // dataValuesAE10
    let dataValuesAE10 = new DataValues();
    dataValuesAE10.values = Array.from(defaultAE10);
    dataValuesAE10.name = "AE10";
    dataValuesAE10.unit = "OHMM";
    dataValuesAE10.selected = true;
    dataValuesAE10.updateMinMax();
    // dataValuesAE20
    let dataValuesAE20 = new DataValues();
    dataValuesAE20.values = Array.from(defaultAE20);
    dataValuesAE20.name = "AE20";
    dataValuesAE20.unit = "OHMM";
    dataValuesAE20.selected = false;
    dataValuesAE20.updateMinMax();
    // dataValuesAE30
    let dataValuesAE30 = new DataValues();
    dataValuesAE30.values = Array.from(defaultAE30);
    dataValuesAE30.name = "AE30";
    dataValuesAE30.unit = "OHMM";
    dataValuesAE30.selected = false;
    dataValuesAE30.updateMinMax();
    // dataValuesAE60
    let dataValuesAE60 = new DataValues();
    dataValuesAE60.values = Array.from(defaultAE60);
    dataValuesAE60.name = "AE60";
    dataValuesAE60.unit = "OHMM";
    dataValuesAE60.selected = false;
    dataValuesAE60.updateMinMax();
    // dataValuesAE90
    let dataValuesAE90 = new DataValues();
    dataValuesAE90.values = Array.from(defaultAE90);
    dataValuesAE90.name = "AE90";
    dataValuesAE90.unit = "OHMM";
    dataValuesAE90.selected = false;
    dataValuesAE90.updateMinMax();
    // create data facies
    let dataFacies3 = new DataFacies();
    dataFacies3.values = Array.from(defaultFacies3);
    dataFacies3.name = "3";
    dataFacies3.selected = false;
    dataFacies3.updateMergeData();
    // create data samples 3 - 135
    let dataSamples3_135 = new DataSamples();
    dataSamples3_135.name = "135";
    dataSamples3_135.selected = true;
    dataSamples3_135.recommended = true;
    dataSamples3_135.values = Array.from(defaultSamples9_150);
    dataFacies3.dataSamples.push(dataSamples3_135);
    // create data samples 3 - 144
    let dataSamples3_144 = new DataSamples();
    dataSamples3_144.name = "144";
    dataSamples3_144.selected = false;
    dataSamples3_144.recommended = false;
    dataSamples3_144.values = Array.from(defaultSamples9_170);
    dataFacies3.dataSamples.push(dataSamples3_144);
    // create data facies
    let dataFacies9 = new DataFacies();
    dataFacies9.values = Array.from(defaultFacies9);
    dataFacies9.name = "9";
    dataFacies9.selected = false;
    dataFacies9.updateMergeData();
    // create data samples 9 - 150
    let dataSamples9_150 = new DataSamples();
    dataSamples9_150.name = "150";
    dataSamples9_150.selected = false;
    dataSamples9_150.recommended = false;
    dataSamples9_150.values = Array.from(defaultSamples9_150);
    dataFacies9.dataSamples.push(dataSamples9_150);
    // create data samples 9 - 170
    let dataSamples9_170 = new DataSamples();
    dataSamples9_170.name = "170";
    dataSamples9_170.selected = false;
    dataSamples9_170.recommended = true;
    dataSamples9_170.values = Array.from(defaultSamples9_170);
    dataFacies9.dataSamples.push(dataSamples9_170);
    // create data table
    let dataTable = new DataTable();
    dataTable.name = "dataTableDefault";
    dataTable.dataValues.push(dataValuesDepth);
    dataTable.dataValues.push(dataValuesAE10);
    dataTable.dataValues.push(dataValuesAE20);
    dataTable.dataValues.push(dataValuesAE30);
    dataTable.dataValues.push(dataValuesAE60);
    dataTable.dataValues.push(dataValuesAE90);
    dataTable.dataFacies.push(dataFacies3);
    dataTable.dataFacies.push(dataFacies9);
    dataTable.resetSelections();
    return dataTable;
}

